  b 13.05.1948
  b 01.10.1947
  Timothy b. at Gisborne and m at St Barnabas Church, Fendalton,
  Christchurch. Jennifer, d/o Eric Chapman (NZ High Commissioner to
  Canberra, 1972-75) and Rhondda Wanty. Address: "Sherwood" Station, RD 2,
  Gisborne.
  Timothy was educated at Huntley School, Marton, and then at Christ's
  College where he was stroke of the rowing eight. He then attended Lincoln
  College and gained a Diploma of Farming.
  Jennifer was educated at St Margaret's College, Christchurch, after which she completed a
  secretarial course and worked for barristers and solicitors.
  After their marriage, Timothy and Jennifer worked in North Auckland for a year then returned to
  their present home at "Sherwood" station (which is now about half of the original "Sherwood"). In
  1986 they were Farmer of the Year for 1985-86 for the Gisborne East Coast region. They have leased
